  height: 60px;
  color: white;
  background-color: rgba(255, 228, 214, 0.9);
`
const Wrapper = styled.div`
  padding: 10px 20px;
`
const Left = styled.div``
const Center = styled.div``
const Right = styled.div``

const NavBar = () => {
  return (
    <Container>
      <Wrapper>NavBar</Wrapper>
    </Container>
  )
}

export default NavBar
